/**
 * Get Range Selection IDs.
 *
 * Get range selection ids based on list of ids (module's children property), selected id from
 * that list, and currently picked id. Abstraction of shift + click where selecting item then
 * click its sibling while pressing shift will select everything in between.
 *
 * @since ??
 *
 * @param {string} id Module id.
 * @param {string[]} siblingIds Ids of sibling of Module id.
 * @param {string[]} selectedIds Ids of selected module. This assume that the order of id matches
 * to the order of selection ([1, 2] means i is selected first, then 2).
 *
 * @returns {string[]} Range selection ids.
 *
 * @example
 * ```js
 * const siblingIds = ['module1', 'module2', 'module3', 'module4', 'module5'];
 * const selectedIds = ['module1'];
 * const id = 'module4';
 * const rangeSelection = getRangeSelectionIds(id, siblingIds, selectedIds);
 * // => ['module2', 'module3', 'module4']
 * ```
 */
export declare const getRangeSelectionIds: (id: string, siblingIds: string[], selectedIds: string[]) => string[];
